<script class="modal_source" define="{noticeSapoModal: new Components.Modal(this)}" type="text/html">
    <div class="modal-dialog modal-dialog-new" style="width: 625px;">
        <div class="modal-content">
            <div class="modal-header">
                <span class="ui-dialog-title" style="text-transform: uppercase; font-weight: 500; text-align: center;">
                    Thông báo
                </span>
                <span class="modal-close-wrapper" bind-event-click="closePopupNotice()">
                    <svg class="ui-icon-x ui-icon-x-20">
                        <use xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="#cancel-small-minor"></use>
                    </svg>
                </span>
            </div>
            <div class="modal-body pull-center cancel-order">
                <p style="font-size: 15px; text-align: left; line-height: 1.8;">
                    Hiện tại Sapo đang gặp sự cố máy chủ ảnh hưởng tới một phần dữ liệu cũ và dữ liệu mới tạo không hiển thị ở danh sách và tìm kiếm.
                    Các phần đồng bộ kênh tạm thời đang ngắt.
                    Tuy nhiên anh/chị lưu ý dữ liệu chỉ tạm thời bị chậm nên anh/chị không cần thao tác lại tránh bị lặp 2 lần.
                    Kỹ thuật Sapo đang khẩn trương khắc phục sự cố.<br/> Rất xin lỗi anh/chị về sự cố không mong muốn này.<br/> Chân thành cảm ơn anh/chị.
                </p>
            </div>
            <div class="modal-footer">
                <div class="action-btn clearfix">
                    <a class="close-modal btn sapo-btn-blank pull-right" href="javascript:" bind-event-click="closePopupNotice()">Thoát</a>
                </div>
            </div>
        </div>
    </div>
</script>
