            <div class="modal-body">
                <div style="text-align: center; display: block">
                    <img src="/v2/images/shipper/logo_sapoexpress-active.svg" style="width: 199px" />
                </div>
                <div style="margin-top: 15px;">
                    <p class="textConnect">Bạn chưa kết nối với Sapo Express?</p>
                    <p class="textConnect">Sapo Express là cổng vận chuyển giá rẻ dành riêng cho nhà bán lẻ đang sử dụng dịch vụ của Sapo, giúp đẩy đơn nhanh chóng qua các đơn vị vận chuyển chất lượng như GHN Express, Ninja Van, Shippo với phí ship toàn quốc siêu rẻ chỉ từ 16,500đ.</p>
                    <p class="textConnect">Để sử dụng dịch vụ, bạn vui lòng click Tiếp tục để kết nối với Sapo Express.</p>
                </div>

            </div>
            <div class="modal-footer">
                <div class="action-btn clearfix">
                    <a class="btn sapo-btn-default" data-no-turbolink="true" id="link-report-old" href="/admin/shippers?connect=SAPOEXPRESS" style="float: right; margin-left: 10px;">Tiếp tục</a>
                    <button class="close-modal btn sapo-btn-blank pull-right" id="close-popup" type="button">Thoát</button>
                </div>
            </div>
        </div>
    </div>
</script>
