<script type="text/html" id="customer-address-template">
    <%
    if(fullName !=null && fullName !=undefined &&  fullName !=""){
    %>
    <div class="label w100"><%- fullName %></div><%
    }

    if(phoneNumber !=null && phoneNumber!=undefined && phoneNumber!=""){
    %>
    <div class="w100"><%- phoneNumber %></div><%
    }
    %>
    <div class="w100">
        <%- sumAddress %>
    </div>


</script>
<script type="text/html" id="customer-address-select-template">
    <div class="item-address">
        <div bind-event-click="changeAddressTmp(${id},'${type}',true)" style="cursor:pointer">
            <%
            if(fullName !=null && fullName !=undefined && fullName !=""){
            %>
            <div class="label"><%- fullName %></div><%
            }


            if(phoneNumber !=null && phoneNumber!=undefined && phoneNumber!=""){
            %>
            <div>${phoneNumber}</div><%
            }
            %>
            <div class="w100">
                <%- sumAddress %>
            </div>
        </div>
        <a href="javascript" bind-event-click=showUpdateAddress(${id},'${type}')>Sửa</a>
    </div>
</script>
<script type="text/html" id="customer-contact-template">
    <%
    if(name !=null && name!=undefined && name!=""){
    %>
    <div class="label w100"><%- name %></div><%
    }
    else{
    %>
    <div class="w100">--</div><%
    }

    if(phoneNumber !=null && phoneNumber!=undefined && phoneNumber!=""){
    %>
    <div class="w100">${phoneNumber}</div><%
    }
    else{
    %>
    <div class="w100">--</div><%
    }

    if(email !=null && email!=undefined && email !=""){
    %>
    <div class="w100">${email}</div><%
    }
    else{
    %>
    <div class="w100">--</div><%
    }
    %>
</script>
