        %>
        <div>${phoneNumber}</div><%
        }
        else{
        %>
        <div>--</div><%
        }

        if(email !=null && email!=undefined && email !=""){
        %>
        <div>${email}</div><%
        }
        else{
        %>
        <div>--</div><%
        }
        %>
    </div>
</script>
