                    <script type="text/html" id="page-gift-promotion-template">
                        <div class="dataTables_paginate paging_bootstrap left">
                            <div class="left">
                                Hiển thị kết quả từ ${range} trên tổng ${totalCount}
                            </div>
                            <%
                            if(totalPage>1){
                            %>
                            <ul class="pagination right">
                                <%
                                if(1>= page){
                                %>
                                <li class="disabled">
                                    <a class="t-state-disabled t-link">
                                        <span class="t-icon t-arrow-first">← Trang đầu</span>
                                    </a>
                                </li>
                                <%
                                }
                                else{
                                %>
                                <li>
                                    <a class="t-link" href="javascript:" bind-event-click="showListGift(1)">
                                        <span class="t-icon t-arrow-first">← Trang đầu</span>
                                    </a>
                                </li>
                                <%
                                }
                                %>

                                <%
                                var start=1;
                                var end=totalPage;
                                if(totalPage>5)
                                {

                                if(2>=page)
                                {
                                if(page>totalPage-2)
                                {
                                start=page;
                                end=totalPage;
                                }
                                else
                                {
                                start=1;
                                end=page+2;
                                }
                                }
                                else
                                {
                                if(page>totalPage-2)
                                {
                                start=page-2;
                                end=totalPage;
                                }
                                else
                                {
                                start=page-2;
                                end=page+2;
                                }
                                }

                                }
                                for(var i = start; i <= end; i++)
                                {
                                if(i==page)
                                {
                                %>
                                <li class="active">
                                    <span class="t-state-active">${page}</span>
                                </li>
                                <%
                                }
                                else{
                                %>
                                <li>

                                    <a class="t-link" href="javascript:" bind-event-click="showListGift(${i})">${i}</a>
                                </li>
                                <%
                                }
                                }

                                %>

                                <%
                                if(page>=totalPage){
                                %>
                                <li class="disabled">
                                    <a class="t-state-disabled t-link">
