        %>
        <% _.forEach(promotions, function(item) { %>
        <div class="col-12 promotion-selected-${item.id}">
            <div style="display:flex">
                <%if(item.allowPromotion==true)
                {
                %>
                <span class="sapo-checkbox left">
                    <input class="sapo-checkbox__input" checked type="checkbox" id="allow-discount-promotion-${item.id}" bind-event-blur="applyOrderDiscount(this)" >
                    <span class="sapo-checkbox__checkmark"></span>
                </span>
                <%
                }%>
                <div class="label left">${item.discountPromotionName}</div>
            </div>
            <i class="padding_left30 left">
                Giảm giá  ${item.discountPromotionTxt}
            </i>
        </div>
        <% }); %>
        <div class="col-12">
            <div class="label">Lý do</div>
            <div><input value="${reasonManual}" bind="orderReasonManualTmp" class="sapo-textbox" bind-event-input="removeValidateLimit(this,250)" bind-event-blur="applyOrderDiscount(this)" /></div>
        </div>
    </div>

</script>
<script type="text/html" id="warranty-line-item-template">
    <div class="content__popup_variant fl position-absolute popover bs-popover-right flex">
        <div class="arrow"></div>
        <div class="content__popup_variant-header left">
            <div class="content__popup_variant-header--name left">
                ${formatedName}
            </div>
        </div>
        <div class="content__popup_variant-body" style="padding-top:20px">
            <div class="row w100 content-warranty">
                <div class="col-8">
                    <div style="font-weight:500;font-size:12px">
                        Tên chính sách bảo hành
                    </div>
                </div>
                <div class="col-4">
                    <div style="font-weight:500;font-size:12px">
                        Kỳ hạn bảo hành
                    </div>
                </div>
            </div>
            <hr />
            <div class="row w100 content-warranty">
                <div class="col-8">
                    ${warrantyName}
                </div>
                <div class="col-4">
                    <div>
                        <%
                        if(termType == "day")
                        {
                        %>
                        ${termNumber} <span>ngày</span>
                        <%
                        }
                        else if( termType== "week")
                        {
                        %>
                        ${termNumber} <span>tuần</span>
                        <%
                        }
                        else if( termType== "month")
                        {
                        %>
                        ${termNumber} <span>tháng</span>
                        <%
                        }
                        else if( termType== "quarter")
                        {
                        %>
                        ${termNumber} <span>quý</span>
                        <%
                        }
                        else if( termType== "year")
                        {
                        %>
                        ${termNumber} <span>năm</span>
                        <%
                        }
                        %>
                    </div>
                </div>
            </div>
        </div>
    </div>
</script>

<script type="text/html" id="inventory-line-item-template">
    <div class="content__popup_variant fl position-absolute popover bs-popover-right flex">
        <div class="arrow"></div>
        <div class="content__popup_variant-header left">
            <div class="content__popup_variant-header--name left">
                ${formatedName}
            </div>
            <div class="content__popup_variant-header--icon left">
                <a class="fa fa-arrow-circle-right" target="_blank" href="/admin/products/${productId}/variants/${variantId}/locations"></a>
            </div>
        </div>
        <div class="content__popup_variant-body">
            <div class="row w100">
                <div class="col-6">
                    <div class="hover-card__title">Giá</div>
                    <div class="hover-card__item hover-card__item__first">
                        <div class="hover-card__item__name">Giá buôn</div>
                        <div class="hover-card__item__number">${wholeSalePriceCurrency}</div>
                    </div>
                    <div class="hover-card__item">
                        <div class="hover-card__item__name">Giá lẻ</div>
                        <div class="hover-card__item__number">${retailPriceCurrency}</div>
                    </div>
                </div>
                <div class="col-6">
                    <div class="hover-card__title">Thuộc tính</div>
                    <div class="hover-card__item hover-card__item__first">
                        <div class="hover-card__item__name">Áp dụng thuế</div>
                        <div class="hover-card__item__number">
                            <%
                            if(taxable ==true)
                            {
                            %>
                            <i style="color:#0088FF" class="fa fa-check" aria-hidden="true"></i>
                            <%
                            }
                            else
                            {
                            %>
                            <i style="color:#B41C37" class="fa fa-times-circle" aria-hidden="true"></i>
                            <%
                            }
                            %>
                        </div>
                    </div>
                </div>
            </div>
        </div>

        <div class="newscroll content__popup_variant-inventory">
            <div class="row w100">
                <div class="col-6">
                    <div class="hover-card__title">${locationCurrent.name}</div>
                    <div class="hover-card__item hover-card__item__first">
                        <div class="hover-card__item__name">
                            Có thể bán&nbsp;
                            <%
                            if(locationCurrent.available < quantity)
                            {
                            %>
                            <i class="fa fa-exclamation-triangle"></i>
                            <%
                            }
                            %>
                        </div>
                        <div class="hover-card__item__number">${locationCurrent.available}</div>
                    </div>
                    <div class="hover-card__item">
                        <div class="hover-card__item__name">Tồn kho</div>
                        <div class="hover-card__item__number">${locationCurrent.onHand}</div>
                    </div>
                    <div class="hover-card__item">
                        <div class="hover-card__item__name">Hàng đang về</div>
                        <div class="hover-card__item__number">${locationCurrent.incoming}</div>
                    </div>
                </div>
                <div class="col-6">
                    <div class="hover-card__title">Tồn hệ thống</div>
                    <div class="hover-card__item hover-card__item__first">
                        <div class="hover-card__item__name">Có thể bán</div>
                        <div class="hover-card__item__number">${totalAvailable}</div>
                    </div>
                    <div class="hover-card__item">
                        <div class="hover-card__item__name">Tồn kho</div>
                        <div class="hover-card__item__number">${totalOnHand}</div>
                    </div>
                    <div class="hover-card__item">
                        <div class="hover-card__item__name">Hàng đang về</div>
                        <div class="hover-card__item__number">${totalIncoming}</div>
                    </div>
                </div>
            </div>

            <div class="row w100">
                <% _.forEach(locations, function(location) { %>
                <div class="col-6">
                    <div class="hover-card__title">${location.name}</div>
                    <div class="hover-card__item hover-card__item__first">
                        <div class="hover-card__item__name">
                            Có thể bán&nbsp;
                            <%
                            if(location.available < quantity)
                            {
                            %>
                            <i class="fa fa-exclamation-triangle"></i>
                            <%
                            }
                            %>
                        </div>
                        <div class="hover-card__item__number">${location.available}</div>
                    </div>
                    <div class="hover-card__item">
                        <div class="hover-card__item__name">Tồn kho</div>
                        <div class="hover-card__item__number">${location.onHand}</div>
                    </div>
                    <div class="hover-card__item">
                        <div class="hover-card__item__name">Hàng đang về</div>
                        <div class="hover-card__item__number">${location.incoming}</div>
                    </div>
                </div>
                <% }); %>
            </div>

        </div>

    </div>
</script>
<script type="text/html" id="variant-serial-filter">
    <div class="w-100">
        <table class="w-100 sapo-table">
            <thead>
                <tr>
                    <th style="width:30%">Mã SKU</th>
                    <th style="width:70%">Tên sản phẩm</th>
                </tr>
            </thead>
            <tbody>
                <% _.forEach(variants, function(variant) { %>
                <tr bind-event-click="addVariantSerial(${variant.id}, '${serial}')" style="cursor:pointer">
                    <td>${variant.sku}</td>
                    <td style="white-space:normal !important">${variant.name}</td>
                </tr>
                <% }); %>
            </tbody>
        </table>

    </div>
</script>
